import '../styles/main.scss'

const Links = (props) => {



  return (

    <ul class='menu-item'>
      <li>
        <a tittle='Blog' class='menu-link' href='https://adalab.blog/' target={props.openInNewTab ===true ? '_blank' : ''}>
          blog
        </a>
      </li>
      <li>
        {' '}
        <a
          href='https://adalab.es/contacto/'
          target={props.openInNewTab===true ? '_blank' : ''}
          rel='noreferrer'
          class='menu-link'
          title='Contacto'
        >
          contacto{' '}
        </a>{' '}
      </li>
    </ul>
  );
};

export default Links;
